import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/Button';
import Landing from './components/Landing';
var lonvar=null;
var latvar=null;
function App() {
  const fireevent = () => {
    // alert("");
    console.log("going here");
   if(((Math.abs(latvar)-Math.abs(43.59884891145078)<=0.1) || (Math.abs(latvar)-Math.abs(43.59884891145078)>=-0.1)) &&
   ((Math.abs(lonvar)-Math.abs(-79.60018749457815)<=0.1) || (Math.abs(lonvar)-Math.abs(-79.60018749457815)>=-0.1))  ){
<a-scene embedded arjs='sourceType: webcam; debugUIEnabled: false;'>
    <a-text 
    text="value: uwin" 
    color="blue"   
    rotation="-90 0 0"
    gps-entity-place="latitude: 43.59884891145078; longitude: -79.60018749457815;"
    ></a-text>
<a-marker-camera preset='custom' type='pattern' url='./pattern-logo.patt'></a-marker-camera>
 </a-scene>
   }else{
    alert("You are not at this location, get lost");
   }

  }

  return (
    <div className="App">
      {
        navigator.geolocation.getCurrentPosition(function(position) {
          console.log("Latitude is :", position.coords.latitude);
           console.log("Longitude is :", position.coords.longitude);
           latvar=position.coords.latitude;
           lonvar=position.coords.longitude;
         })
      }
 <Button onClick="fireevent()" variant="primary" size="lg">
    Block level button
  </Button>


    </div>
  );
}

export default App;
